import React, { useState } from 'react';
import axios from 'axios';

const SaveUserData = () => {
    const [formData, setFormData] = useState({
        name: '',
        address: '',
        location: ''
    });
    const [status, setStatus] = useState('');

    const handleChange = (e) => {
        setFormData({
            ...formData,
            [e.target.name]: e.target.value
        });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            const response = await axios.post('http://localhost:5002/predict', {
                ...formData,
                data: JSON.stringify(formData)
            });
            setStatus('Data saved successfully! Transaction Hash: ' + response.data.transaction_hash);
            setFormData({ name: '', address: '', location: '' });
        } catch (error) {
            setStatus(error.response?.data?.error || 'Failed to save data');
        }
    };

    return (
        <div>
            <h1>Save User Data</h1>
            {status && <p>{status}</p>}
            <form onSubmit={handleSubmit}>
                <div>
                    <label>Name</label>
                    <input
                        type="text"
                        name="name"
                        value={formData.name}
                        onChange={handleChange}
                        required
                    />
                </div>
                <div>
                    <label>Address</label>
                    <input
                        type="text"
                        name="address"
                        value={formData.address}
                        onChange={handleChange}
                        required
                    />
                </div>
                <div>
                    <label>Location</label>
                    <input
                        type="text"
                        name="location"
                        value={formData.location}
                        onChange={handleChange}
                        required
                    />
                </div>
                <button type="submit">Save Data</button>
            </form>
        </div>
    );
};

export default SaveUserData;
